import Navbar from './components/Navbar'; 
import Sidebar from './components/Sidebar'
import MainContent from './components/Maincontent';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className='container'>
      <Sidebar />
      <MainContent />
      </div>
    </div>
  );
}

export default App;
